import React from 'react';
import '../App.css';
import './ServiceSection.css';

function ServiceSection() {
    return (
      <div className='services-container'>        
        <h1>Services</h1>   
        <p>Located less than a 3Km away from amba ghat, at Aranyagiri Farmhouse room are spacious and clean with attached balcony which open up to a garden view. Room comes with a large double bed and extra bed on request. Premises provide ample parking space and a garden with large coconut and local fruit trees. One can truly relax and enjoy the clean soft sand, long undisturbed walks and most of all breathe pure oxygen. 
          Our main aim is to provide you with relaxing atmosphere with a homely feel!</p>    
      </div>
    );
  }
  
  export default ServiceSection;
